/*
*  Check conditions for RetriggerOnEvent  
*  @return  nothing
*  @param   enEvt event (WIM__nInit, WIM__nDeinit, WIM__nCyclic)
*  @author  T.Godemann, Schleissheimer GmbH
*/
static void WIM__vCheckRetriggerOnEvent(WIM__tenEventIntern enEvt)
{
   /***************************************************************************
   * FUNCTION LOCAL DEFINITIONS
   ****************************************************************************/
   static uint8 u8OldAdblueEU6_Msg_Disp_TrgrRq;
   uint8 u8My_AdblueEU6_Msg_Disp_TrgrRq;
   /***************************************************************************
   * FUNCTION CODE
   ****************************************************************************/
   if (/* init? */
      enEvt == WIM__nInit)
   {
      /* takeover new value */
      u8OldAdblueEU6_Msg_Disp_TrgrRq = 0xFF;
   }
   else
   {
      /**** check condition for RTGR_ADBLUE ****/
      Com_ReceiveSignal(Com_AdblueEU6_Msg_Disp_TrgrRq,&u8My_AdblueEU6_Msg_Disp_TrgrRq);
      if (/* value received and no time-out? */
         Com_GetRxSigFirstValueFlag(Com_AdblueEU6_Msg_Disp_TrgrRq) != WIM__nPassive
         && Com_GetRxSigTimeoutFlag(Com_AdblueEU6_Msg_Disp_TrgrRq) == WIM__nPassive)
      {
         if (/* new value is one */
            u8My_AdblueEU6_Msg_Disp_TrgrRq == 0x01
            /* and old value was zero? */
            && u8OldAdblueEU6_Msg_Disp_TrgrRq == 0x00)
         {
            /* retrigger connected warnings */
            WIM__vReqCtrlRetriggerAdBlue();
         }
         /* takeover new value */
         u8OldAdblueEU6_Msg_Disp_TrgrRq = u8My_AdblueEU6_Msg_Disp_TrgrRq;
      }
   }
}

