/**
 * Set (if not registered) or retrigger warning
 *    @return void
 *    @param  u32HilId Hil Id
 *    @param  pboIsManuQuit
 *    @author D.Vinevtsev, Schleissheimer GmbH
 */
static void WIM__vElStepboardSetOrRetriggerIntEvent(int u32HilId, bool* pboIsManuQuit)
{
   if (WIM_boIsRegistered(u32HilId) == True)
   {
      if (/* Message is ManuQuit */
         *pboIsManuQuit == True)
      {
         /* Retrigger warning with sound */
         WIM_vRetriggerIntEvent(u32HilId);

         /* Set ManuQuit to False */
         *pboIsManuQuit = False;
      }
      else
      {
         /* Retrigger warning only display */
         WIM_vRetriggerDisplay(u32HilId);
      }
   }
   else
   {
      /* Activate warning */
      WIM_vSetIntEvent(u32HilId);
   }
}

/**
 * Check ALDW and Parktronic acoustics inside warnings
 * 
 * @return None
 * @param enEvt event (WIM__nInit, WIM__nDeinit, WIM__nCyclic)
 * @author D.Vinevtsev, Schleissheimer GmbH
 * @description Special handling for 0x20F3C5
 */
static void WIM__vCheckALDWAcoustic(WIM__tenEventIntern enEvt)
{   
   /* ************************************************************ */
   /*  FUNCTION LOCAL DEFINITIONS                                  */
   /* ************************************************************ */
   uint8 u8_ALDW_LDP_Warn_Rq;
   bool boFv_ALDW_LDP_Warn_Rq;
   bool boTo_ALDW_LDP_Warn_Rq;
   uint8 u8_ALDW_Acoust_Warn_Counter;
   
   /* ************************************************************ */
   /*  FUNCTION CODE                                               */
   /* ************************************************************ */
   if (enEvt != WIM__nCyclic)
      return;

   /* Read CAN-signals */
   WIM__mvLock();
   {
      Com_ReceiveSignalGroup(Com_Grp_CamLane_LaneAttr7_Pr2);
      Com_ReceiveShadowSignal(Com_ALDW_LDP_Warn_Rq, &u8_ALDW_LDP_Warn_Rq);
      boFv_ALDW_LDP_Warn_Rq = Com_GetRxSigGrpFirstValueFlag(Com_Grp_CamLane_LaneAttr7_Pr2);
      boTo_ALDW_LDP_Warn_Rq = Com_GetRxSigGrpTimeoutFlag(Com_Grp_CamLane_LaneAttr7_Pr2);
   }
   WIM__mvUnLock();

   /* Check the first value and timeout flags */
   if (boTo_ALDW_LDP_Warn_Rq != WIM__nPassive || boFv_ALDW_LDP_Warn_Rq == WIM__nPassive)
      return;

   /* Read counter from EEProm */
   u8_ALDW_Acoust_Warn_Counter = EEH_biGetALDW_Acoustic_Warning();

   /* If counter isn't zero */
   if (u8_ALDW_Acoust_Warn_Counter != 0)
   {
      /* Turn on condition */
      if (u8_ALDW_LDP_Warn_Rq == 0x1 || u8_ALDW_LDP_Warn_Rq == 0x2)
      {
         if (!WIM_boIsRegistered(WIM__nHilIdALDWWarnton))
         {
            WIM__u8CounterStartsAcousticRetrigger = u8_ALDW_Acoust_Warn_Counter;
            WIM_vSetIntEvent(WIM__nHilIdALDWWarnton);
         }         
      }
      /* Turn off condition */
      else if (u8_ALDW_LDP_Warn_Rq != 0x1 && u8_ALDW_LDP_Warn_Rq != 0x2)
      {
         WIM_vRelIntEvent(WIM__nHilIdALDWWarnton);
      }
   }
   else
   {
      WIM_vRelIntEvent(WIM__nHilIdALDWWarnton);
   }
}

/**
 * Check conditions for electrical step board (warnings 0x20F3B1, 0x20F3B2)
 *
 * @return None
 * @param enEvt event (WIM__nInit, WIM__nDeinit, WIM__nCyclic)
 * @author D.Vinevtsev, Schleissheimer GmbH
 * @description 0x20F3B1 - Stepboard not moved out, 0x20F3B2 - Stepboard not moved in
 */
static void WIM__vCheckElectricalStepBoard(WIM__tenEventIntern enEvt)
{
   /* ************************************************************ */
   /*  FUNCTION LOCAL DEFINITIONS                             */
   /* ************************************************************ */

   /* Display state of electrical step board */
   static uint8 u8PrevElStepBoardDisplayState = 0x00, u8ElStepBoardDisplayState = 0x00;

   /* Electrical step signals */

   /* Front left electrical step state */
   uint8 u8EStep_FL_Flt = 0;   

   /* Front right electrical step state */
   uint8 u8EStep_FR_Flt = 0;   

   /* Rear left electrical step state */
   uint8 u8EStep_RL_Flt = 0;   

   /* Rear right electrical step state */
   uint8 u8EStep_RR_Flt = 0;   

   /* variables for acoustic signals */
   uint8 u8EStep_AcustWarn1_On_Rq = 0, u8EStep_AcustWarn2_On_Rq = 0;

   /* First value and timeout flags */
   bool boFvElStepBoard;
   bool boToElStepBoard;

   /* Old electrical stepboard state */
   uint8 u8OldElStepboardState;

   /* Turn off condition 0x20F3B1, 0x20F3B2 */
   bool boTurnOffCondition;

   /* Turn on condition for 0x20F3B1, 0x20F3B2 */
   bool boTurnOnCondition;

   /* The electircal stepboard state is changed */
   bool boElStepBoard_StateChanged;

   /* E-step acoustic 1 is active */
   bool boElStepAcoust1_Activated;

   /* E-step acoustic 1 is inactive */
   bool boElStepAcoust1_Deactivated;

   /* E-step acoustic 2 is active */
   bool boElStepAcoust2_Activated;

   /* E-step acoustic 2 is inactive */
   bool boElStepAcoust2_Deactivated;

   /* ************************************************************ */
   /*  FUNCTION CODE                                               */
   /* ************************************************************ */
   if (enEvt != WIM__nCyclic)
   {
      /* Init electrical step board state */
      u8PrevElStepBoardDisplayState = 0x00;
      WIM__boElStepBoardMovedIn_ManuQuit = False;
      WIM__boElStepBoardMovedOut_ManuQuit = False;
      return;
   }     

   /* backup old electrical step board state */
   u8OldElStepboardState = u8ElStepBoardDisplayState;   

   /* Read CAN-signals */
   WIM__mvLock();
   {
      /* Electrical step signals */
      Com_ReceiveSignalGroup(Com_Grp_SPV_Stat_VAN_Pr2);

      Com_ReceiveShadowSignal(Com_EStep_FL_Flt, &u8EStep_FL_Flt);      
      Com_ReceiveShadowSignal(Com_EStep_FR_Flt, &u8EStep_FR_Flt);
      Com_ReceiveShadowSignal(Com_EStep_RL_Flt, &u8EStep_RL_Flt);
      Com_ReceiveShadowSignal(Com_EStep_RR_Flt, &u8EStep_RR_Flt);

      /* Acoustic signals */
      Com_ReceiveSignalGroup(Com_Grp_SPV_Stat_VAN_Pr2);
      Com_ReceiveShadowSignal(Com_EStep_AcustWarn1_On_Rq, &u8EStep_AcustWarn1_On_Rq);
      Com_ReceiveShadowSignal(Com_EStep_AcustWarn2_On_Rq, &u8EStep_AcustWarn2_On_Rq);

      /* First value and timeout flags */
      Com_ReceiveSignalGroup(Com_Grp_SPV_Stat_VAN_Pr2);
      boFvElStepBoard = Com_GetRxSigGrpFirstValueFlag(Com_Grp_SPV_Stat_VAN_Pr2);
      boToElStepBoard = Com_GetRxSigGrpTimeoutFlag(Com_Grp_SPV_Stat_VAN_Pr2);
   }
   WIM__mvUnLock();

   if (boToElStepBoard == WIM__nPassive && boFvElStepBoard != WIM__nPassive)
   {
      /* Setting up the display state for 0x20F3B1, 0x20F3B2 */
      WIM__vSetUpElStepDisplayState(&u8ElStepBoardDisplayState, u8EStep_FL_Flt, u8EStep_FR_Flt, u8EStep_RL_Flt, u8EStep_RR_Flt);

      boTurnOffCondition = u8EStep_FL_Flt == 0 && u8EStep_FR_Flt == 0 && u8EStep_RL_Flt == 0 && u8EStep_RR_Flt == 0;

      boTurnOnCondition = u8EStep_FL_Flt == 1 || u8EStep_FR_Flt == 1 || u8EStep_RL_Flt == 1 || u8EStep_RR_Flt == 1;           
      boElStepBoard_StateChanged = (~u8OldElStepboardState & u8ElStepBoardDisplayState) != 0;

      /******************************** 0x20F3B1 electrical stepboard handling ********************************/

      boElStepAcoust2_Activated = u8EStep_AcustWarn2_On_Rq == 1;
      boElStepAcoust2_Deactivated = u8EStep_AcustWarn2_On_Rq == 0;

      if (boElStepAcoust2_Activated && boElStepBoard_StateChanged)
      {
         /* Set (if not registered) or retrigger warning 0x20F3B1 */
         WIM__vElStepboardSetOrRetriggerIntEvent(WIM__nElecStepboardMovedOut, &WIM__boElStepBoardMovedOut_ManuQuit);
      }
      else
      {         
         if (boTurnOffCondition && boElStepAcoust2_Deactivated)
         {            
            /* Unregister warning 0x20F3B1 */
            WIM_vRelIntEvent(WIM__nElecStepboardMovedOut);
         }
         else if (boElStepAcoust2_Activated && boTurnOnCondition)
         {            
            /* Register warning 0x20F3B1 */
            WIM_vSetIntEvent(WIM__nElecStepboardMovedOut);
         }
      }

      /******************************** 0x20F3B2 electrical stepboard handling ********************************/

      boElStepAcoust1_Activated = u8EStep_AcustWarn1_On_Rq == 1;
      boElStepAcoust1_Deactivated = u8EStep_AcustWarn1_On_Rq == 0;
       
      if (boElStepAcoust1_Activated && boElStepBoard_StateChanged)
      {        
         /* Set (if not registered) or retrigger warning 0x20F3B2 */
         WIM__vElStepboardSetOrRetriggerIntEvent(WIM__nElecStepboardMovedIn, &WIM__boElStepBoardMovedIn_ManuQuit);

         /* Set (if not registered) or retrigger warning 0x20F3C9 */
         WIM__vElStepboardSetOrRetriggerIntEvent(WIM__nElecStepboardMovedIn_Acust1, &WIM__boElStepBoardMovedIn_ManuQuit);
      }
      else
      {                          
         if (boTurnOffCondition)
         {
            /* Unregister warning 0x20F3B2 */
            WIM_vRelIntEvent(WIM__nElecStepboardMovedIn);
            
            /* Reset the manual confirmation */
            WIM__boElStepBoardMovedIn_ManuQuit = False;
         }
         else if (boElStepAcoust1_Activated && boTurnOnCondition)
         {
            // Register warning 0x20F3B2
            WIM_vSetIntEvent(WIM__nElecStepboardMovedIn);

            // Register warning 0x20F3C9
            WIM_vSetIntEvent(WIM__nElecStepboardMovedIn_Acust1);
         }
         
         /* There has been a manual confirmation for 0x20F3B2 */
         if (boElStepAcoust1_Deactivated || WIM__boElStepBoardMovedIn_ManuQuit)
         {
            /* Unregister acoustic warning 0x20F3C9 */
            WIM_vRelIntEvent(WIM__nElecStepboardMovedIn_Acust1);
         }
      }
   }   

   // Send DPOOL data (if changed) for electrical step board warnings
   if (u8ElStepBoardDisplayState != u8PrevElStepBoardDisplayState)
   {
      u8PrevElStepBoardDisplayState = u8ElStepBoardDisplayState;
      if (E_DATA_OK != DPOOL_enSetPoolData(DPOOL_nDataWIM_u8ElStepBoard, &u8ElStepBoardDisplayState))
      {
         WIM__vRaiseException(WIM_nErrIcom);
      }
   }   
}

/**
 * Check conditions for GPS tracking status (warnings 0x20F3B3, 0x20F3B4)
 * @return none
 * @param enEvt event (WIM__nInit, WIM__nDeinit, WIM__nCyclic) 
 * @author D.Vinevtsev, Schleissheimer GmbH
 */
static void WIM__vCheckVanTrackingStatus(WIM__tenEventIntern enEvt)
{
   /* ************************************************************ */
   /*  FUNCTION LOCAL DEFINITIONS                                  */
   /* ************************************************************ */
   /* variables for CAN signal usage */
   uint8 u8My_MBCall_Trck_Actv = 0;
   bool boFvMBCall_Trck_Actv;
   bool boToMBCall_Trck_Actv;
   /* ************************************************************ */
   /*  FUNCTION CODE                                               */
   /* ************************************************************ */
   if (/* init? */
      enEvt != WIM__nCyclic)
   {
      /* inits */
      WIM__u16DisplayTimerVanTrackingStatus = 0;
      WIM__boIgnitionOffToOnChange = False;
      WIM__u8OldSignalValue = 0xFF;
   }
   else
   {
      /* KL15Off detection */
      if (!CST_boGetStatus(CST_nenStatusKl15g))
      {
         WIM__boIgnitionOffToOnChange = False;
         WIM__u8OldSignalValue = 0xFF;
         WIM_vRelIntEvent(WIM__nHilIdVanTrackingStatusActive);
      }

      /* KL15On detection */
      if (CST_boGetStatus(CST_nenStatusKl15g) && !WIM__boIgnitionOffToOnChange)
      {
         WIM__boIgnitionOffToOnChange = True;
      }

      /* Check boundary conditions fullfilled */
      if (/* No headunit available */
         !EEH_boGetHeadunit() &&
         /* HERMES availibility is configured */
         EEH_boGetHermes_avl() &&
         /* Kl15Off -> KL15On changed */
         WIM__boIgnitionOffToOnChange &&
         /* Suppression time for validation is expired */
         TIMER_u16Read(TIMER_nWIM_TimerVanTrackingStatusSuppress) == WIM__nTimerInactive)
      {
         /**** READ CAN SIGNALS **** */
         WIM__mvLock();
         /* Get the signal values */
         Com_ReceiveShadowSignal(Com_MBCall_Trck_Actv, &u8My_MBCall_Trck_Actv);
         boFvMBCall_Trck_Actv = Com_GetRxSigFirstValueFlag(Com_MBCall_Trck_Actv);
         boToMBCall_Trck_Actv = Com_GetRxSigTimeoutFlag(Com_MBCall_Trck_Actv);
         WIM__mvUnLock();

         /* Check turn off condition for 0x20F3B4 */
         if (/* Timeout active */
            boToMBCall_Trck_Actv
            /* or not valid signal value */
            || u8My_MBCall_Trck_Actv != 1)
         {
            /* Deregister warning 0x20F3B4 */
            WIM_vRelIntEvent(WIM__nHilIdVanTrackingStatusActive);

            /* Reset the display timer value */
            WIM__u16DisplayTimerVanTrackingStatus = 0;

            /* Set the old signal value to init */
            WIM__u8OldSignalValue = 0xFF;
         }

         /* Check turn on condition for 0x20F3B4 */
         if (u8My_MBCall_Trck_Actv == 1
            /* No timeout */
            && boToMBCall_Trck_Actv == WIM__nPassive
            /* First value received */
            && boFvMBCall_Trck_Actv != WIM__nPassive
            /* Warning is not active */
            && !WIM_boIsRegistered(WIM__nHilIdVanTrackingStatusActive)
            /* and signal value is changed */
            && WIM__u8OldSignalValue != 1)
         {
            /* Register warning 0x20F3B4 */
            WIM_vSetIntEvent(WIM__nHilIdVanTrackingStatusActive);

            /* Set the display timer time */
            WIM__u16DisplayTimerVanTrackingStatus = WIM_u16DisplayTimeVanTrackingStatus;
         }

         /* Save last signal value, in case of signal is not in timeout */
         if (!boToMBCall_Trck_Actv)
         {
            WIM__u8OldSignalValue = u8My_MBCall_Trck_Actv;
         }
      }
   }
}

/**
* downcount active timer for van tracking status
* if timer elapses
*   @return  void
*   @author  A.Wagner, Schleissheimer GmbH
*/
void WIM__vVanTrackingStatusTime(void)
{
   if (WIM__u16DisplayTimerVanTrackingStatus > 0)
   {
      if (WIM__boVanTrackingStatusDisplayed)
      {
         WIM__u16DisplayTimerVanTrackingStatus--;
      }
   }
   else
   {
      /* Check condition warning 0x20F3B4 */
      if (WIM_u32GetCurrentDisplayMsg() == WIM__nHilIdVanTrackingStatusActive)
      {
         WIM_vRelIntEvent(WIM__nHilIdVanTrackingStatusActive);
         WIM__u16DisplayTimerVanTrackingStatus = 0;
      }
   }
}

