/*
*  Check conditions for door warning 0x2000F2 and 0x200571 
*  @return  none
*  @param   enEvt event (WIM__nInit, WIM__nDeinit, WIM__nCyclic)
*  @author  A.Wagner, Schleissheimer GmbH
*/
static void WIM__vCheckDoorWarning(WIM__tenEventIntern enEvt)
{
   /***************************************************************************
   * FUNCTION LOCAL DEFINITIONS
   ****************************************************************************/
   /* DoorState Front Left */
   uint8 u8My_DrRLtch_FL_Stat = 0x00;
   bool boFvDoor_FL_Stat_Pr2;
   bool boToDoor_FL_Stat_Pr2;

   /* DoorState Front Right */
   uint8 u8My_DrRLtch_FR_Stat = 0x00;
   bool boFvDoor_FR_Stat_Pr2;
   bool boToDoor_FR_Stat_Pr2;

   /* DoorState Rear Left */
   uint8 u8My_PSD_L_PwrCls_Stat = 0x00;
   bool boFvPSL_L_Stat_AR;
   bool boToPSL_L_Stat_AR;

   /* DoorState Rear Right */
   uint8 u8My_PSD_R_PwrCls_Stat = 0x00;
   bool boFvPSL_R_Stat_AR;
   bool boToPSL_R_Stat_AR;

   /* Trunk door */
   uint8 u8My_DL_RLtch_Stat = 0x00;
   bool boFvDL_Lk_Stat;
   bool boToDL_Lk_Stat;

   /* DoorState Side Right */
   uint8 u8My_DrRLtch_RR_Stat = 0x00;
   bool boFvDoor_RR_Stat_Pr2;
   bool boToDoor_RR_Stat_Pr2;

   /* DoorState Side Left */
   uint8 u8My_DrRLtch_RL_Stat = 0x00;
   bool boFvDoor_RL_Stat_Pr2;
   bool boToDoor_RL_Stat_Pr2;

   /* Electrical door configuration */
   bool boMy_EVC_CfgVAN_PSD_R_Avl = 0x00;
   bool boMy_EVC_CfgVAN_PSD_L_Avl = 0x00;
   bool boMy_EVC_CfgVAN_PwrCls_SD_R_Avl = 0x00;
   bool boMy_EVC_CfgVAN_PwrCls_SD_L_Avl = 0x00;
   bool boFvEVC_CfgVAN_Pr2;
   bool boToEVC_CfgVAN_Pr2;

   uint8 u8OldDoorState;

   /***************************************************************************
   * FUNCTION CODE
   ****************************************************************************/
   if (/* init? */
      enEvt != WIM__nCyclic)
   {
      /* init door state */
      WIM__u8DoorState = 0;
      WIM__u8DoorManuQuit = False;
      /* reset old velocity value came from */
      enLastVelocityValue = WIM_enVelLow;
      WIM__u16OldVelocity = 0;
   }
   else
   {
      /* backup old door state */
      u8OldDoorState = WIM__u8DoorState;
      WIM__u8DoorDisplayState = 0x00;
      WIM__u16OldVelocity = WIM__u16GetVelocityDisp();

      /* set state velocity value came from */
      /* coming from 3 km/h */
      if (WIM__u16OldVelocity <= 2)
         enLastVelocityValue = WIM_enVelLow;
      /* coming from 5 km/h */
      else if (WIM__u16OldVelocity >= 6)
         enLastVelocityValue = WIM_enVelHigh;

      /**** READ CAN SIGNALS **** */
      WIM__mvLock();
      /* DoorState Side Right */
      Com_ReceiveSignalGroup(Com_Grp_Door_RR_Stat_Pr2);
      Com_ReceiveShadowSignal(Com_DrRLtch_RR_Stat, &u8My_DrRLtch_RR_Stat);
      boFvDoor_RR_Stat_Pr2 = Com_GetRxSigGrpFirstValueFlag(Com_Grp_Door_RR_Stat_Pr2);
      boToDoor_RR_Stat_Pr2 = Com_GetRxSigGrpTimeoutFlag(Com_Grp_Door_RR_Stat_Pr2);
      /* DoorState Side Left */
      Com_ReceiveSignalGroup(Com_Grp_Door_RL_Stat_Pr2);
      Com_ReceiveShadowSignal(Com_DrRLtch_RL_Stat, &u8My_DrRLtch_RL_Stat);
      boFvDoor_RL_Stat_Pr2 = Com_GetRxSigGrpFirstValueFlag(Com_Grp_Door_RL_Stat_Pr2);
      boToDoor_RL_Stat_Pr2 = Com_GetRxSigGrpTimeoutFlag(Com_Grp_Door_RL_Stat_Pr2);
      /* DoorState Front Left */
      Com_ReceiveSignalGroup(Com_Grp_Door_FL_Stat_Pr2);
      Com_ReceiveShadowSignal(Com_DrRLtch_FL_Stat, &u8My_DrRLtch_FL_Stat);
      boFvDoor_FL_Stat_Pr2 = Com_GetRxSigGrpFirstValueFlag(Com_Grp_Door_FL_Stat_Pr2);
      boToDoor_FL_Stat_Pr2 = Com_GetRxSigGrpTimeoutFlag(Com_Grp_Door_FL_Stat_Pr2);
      /* DoorState Front Right */
      Com_ReceiveSignalGroup(Com_Grp_Door_FR_Stat_Pr2);
      Com_ReceiveShadowSignal(Com_DrRLtch_FR_Stat, &u8My_DrRLtch_FR_Stat);
      boFvDoor_FR_Stat_Pr2 = Com_GetRxSigGrpFirstValueFlag(Com_Grp_Door_FR_Stat_Pr2);
      boToDoor_FR_Stat_Pr2 = Com_GetRxSigGrpTimeoutFlag(Com_Grp_Door_FR_Stat_Pr2);
      /* DoorState Rear Left */
      Com_ReceiveSignal(Com_PSD_L_PwrCls_Stat, &u8My_PSD_L_PwrCls_Stat);
      boFvPSL_L_Stat_AR = Com_GetRxSigFirstValueFlag(Com_PSD_L_PwrCls_Stat);
      boToPSL_L_Stat_AR = Com_GetRxSigTimeoutFlag(Com_PSD_L_PwrCls_Stat);
      /* DoorState Rear Right */
      Com_ReceiveSignal(Com_PSD_R_PwrCls_Stat, &u8My_PSD_R_PwrCls_Stat);
      boFvPSL_R_Stat_AR = Com_GetRxSigFirstValueFlag(Com_PSD_R_PwrCls_Stat);
      boToPSL_R_Stat_AR = Com_GetRxSigTimeoutFlag(Com_PSD_R_PwrCls_Stat);
      /* Trunk door */
      Com_ReceiveSignalGroup(Com_Grp_DL_Lk_Stat);
      Com_ReceiveShadowSignal(Com_DL_RLtch_Stat, &u8My_DL_RLtch_Stat);
      boFvDL_Lk_Stat = Com_GetRxSigGrpFirstValueFlag(Com_Grp_DL_Lk_Stat);
      boToDL_Lk_Stat = Com_GetRxSigGrpTimeoutFlag(Com_Grp_DL_Lk_Stat);
      /* DoorState Rear Left */
      Com_ReceiveSignalGroup(Com_Grp_EVC_CfgVAN_Pr2);
      Com_ReceiveShadowSignal(Com_EVC_CfgVAN_PSD_L_Avl, &boMy_EVC_CfgVAN_PSD_L_Avl);
      /* DoorState Rear Right */
      Com_ReceiveSignalGroup(Com_Grp_EVC_CfgVAN_Pr2);
      Com_ReceiveShadowSignal(Com_EVC_CfgVAN_PSD_R_Avl, &boMy_EVC_CfgVAN_PSD_R_Avl);
      /* DoorState Rear Left */
      Com_ReceiveSignalGroup(Com_Grp_EVC_CfgVAN_Pr2);
      Com_ReceiveShadowSignal(Com_EVC_CfgVAN_PwrCls_SD_L_Avl, &boMy_EVC_CfgVAN_PwrCls_SD_L_Avl);
      /* DoorState Rear Right */
      Com_ReceiveSignalGroup(Com_Grp_EVC_CfgVAN_Pr2);
      Com_ReceiveShadowSignal(Com_EVC_CfgVAN_PwrCls_SD_R_Avl, &boMy_EVC_CfgVAN_PwrCls_SD_R_Avl);
      boFvEVC_CfgVAN_Pr2 = Com_GetRxSigGrpFirstValueFlag(Com_Grp_EVC_CfgVAN_Pr2);
      boToEVC_CfgVAN_Pr2 = Com_GetRxSigGrpTimeoutFlag(Com_Grp_EVC_CfgVAN_Pr2);
      WIM__mvUnLock();

      /* FRONT LEFT DOOR */
      if (boToDoor_FL_Stat_Pr2 == WIM__nPassive && boFvDoor_FL_Stat_Pr2 != WIM__nPassive)
      {
         if (u8My_DrRLtch_FL_Stat == 2)
         {
            WIM__u8DoorState |= (0xff & WIM__nDoorMaskFL);
            WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskFL);
         }
         else if (u8My_DrRLtch_FL_Stat == 1)
         {
            WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskFL);
         }
      }
      /* FRONT RIGHT DOOR */
      if (boToDoor_FR_Stat_Pr2 == WIM__nPassive && boFvDoor_FR_Stat_Pr2 != WIM__nPassive)
      {
         if (u8My_DrRLtch_FR_Stat == 2)
         {
            WIM__u8DoorState |= (0xff & WIM__nDoorMaskFR);
            WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskFR);
         }
         else if (u8My_DrRLtch_FR_Stat == 1)
         {
            WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskFR);
         }
      }
      /* TRUNK DOOR */
      if (boToDL_Lk_Stat == WIM__nPassive && boFvDL_Lk_Stat != WIM__nPassive)
      {
         if (u8My_DL_RLtch_Stat == 2)
         {
            WIM__u8DoorState |= (0xff & (WIM__nDoorMaskTRL | WIM__nDoorMaskTRR));
            WIM__u8DoorDisplayState |= (0xff & (WIM__nDoorMaskTRL | WIM__nDoorMaskTRR));
         }
         else if (u8My_DL_RLtch_Stat == 1)
         {
            WIM__u8DoorState &= (0xff & ~(WIM__nDoorMaskTRL | WIM__nDoorMaskTRR));
         }
      }
      /* three door body? */
      if (EEH_biGetStaticVehLine() == DSFA_nVlBR238)
      {
         /* no rear doors ==> door state closed */
         WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskRL);
         WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskRR);
         WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskElecRL);
         WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskElecRR);
      }
      else
      {
          /* electircal doors */
         /* REAR LEFT DOOR */
         if ((boToPSL_L_Stat_AR == WIM__nPassive && boFvPSL_L_Stat_AR != WIM__nPassive)
             && (boToEVC_CfgVAN_Pr2 == WIM__nPassive && boFvEVC_CfgVAN_Pr2 != WIM__nPassive))
         {
            if (u8My_PSD_L_PwrCls_Stat == 2
                && (boMy_EVC_CfgVAN_PSD_L_Avl
                || boMy_EVC_CfgVAN_PwrCls_SD_L_Avl))
            {
                WIM__u8DoorState |= (0xff & WIM__nDoorMaskElecRL);
                WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskElecRL);
            }
            else if (u8My_PSD_L_PwrCls_Stat == 1
                    || (!boMy_EVC_CfgVAN_PSD_L_Avl
                    && !boMy_EVC_CfgVAN_PwrCls_SD_L_Avl))
            {
                WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskElecRL);
            }
         }
         /* REAR RIGHT DOOR */
         if ((boToPSL_R_Stat_AR == WIM__nPassive && boFvPSL_R_Stat_AR != WIM__nPassive)
             && (boToEVC_CfgVAN_Pr2 == WIM__nPassive && boFvEVC_CfgVAN_Pr2 != WIM__nPassive))
         {
             if (u8My_PSD_R_PwrCls_Stat == 2
                 && (boMy_EVC_CfgVAN_PSD_R_Avl
                 || boMy_EVC_CfgVAN_PwrCls_SD_R_Avl))
            {
                WIM__u8DoorState |= (0xff & WIM__nDoorMaskElecRR);
                WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskElecRR);
            }
             else if (u8My_PSD_R_PwrCls_Stat == 1
                 || (!boMy_EVC_CfgVAN_PSD_R_Avl
                 && !boMy_EVC_CfgVAN_PwrCls_SD_R_Avl))
            {
                WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskElecRR);
            }
         }
         /* mechanical doors */
         /* REAR LEFT DOOR */
         if (boToDoor_RL_Stat_Pr2 == WIM__nPassive && boFvDoor_RL_Stat_Pr2 != WIM__nPassive)
         {
             if (u8My_DrRLtch_RL_Stat == 2)
             {
                 WIM__u8DoorState |= (0xff & WIM__nDoorMaskRL);
                 WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskRL);
             }
             else if (u8My_DrRLtch_RL_Stat == 1)
             {
                 WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskRL);
             }
         }
         /* REAR RIGHT DOOR */
         if (boToDoor_RR_Stat_Pr2 == WIM__nPassive && boFvDoor_RR_Stat_Pr2 != WIM__nPassive)
         {
             if (u8My_DrRLtch_RR_Stat == 2)
             {
                 WIM__u8DoorState |= (0xff & WIM__nDoorMaskRR);
                 WIM__u8DoorDisplayState |= (0xff & WIM__nDoorMaskRR);
             }
             else if (u8My_DrRLtch_RR_Stat == 1)
             {
                 WIM__u8DoorState &= (0xff & ~WIM__nDoorMaskRR);
             }
         }
      }

      /**** CHECK WARNING CONDITION ****/
      /* Warning OFF-condition fullfilled? */
      if (/* all doors are closed*/
         WIM__u8DoorState == 0
         || !CST_boGetStatus(CST_nenStatusKl15g))
      {
         /* release warning 0x20F308 */
         WIM_vRelIntEvent(WIM__nHilIdDoorWarningVolume);
         /* release warning 0x20F309 */
         WIM_vRelIntEvent(WIM__nHilIdDoorWarningMute);

         /* Check rear seatbelt change state */
         if (u8OldDoorState != WIM__u8DoorState )
         {
            SBW_vRearSeatbeltWrn2018();   /* SBW__vRearSeatbeltWrn2018(); */
         }
      }
      /* release warning 0x20F308 if speed under threshold */
      else
      {
         if ((/* speed between thresholds and come from 5  */
               ((WIM__u16GetVelocityDisp() >= 3
                     && WIM__u16GetVelocityDisp() <= 5)
                  && enLastVelocityValue == WIM_enVelLow)
               /* or speed under threshold? */
               || WIM__u16GetVelocityDisp() < 3)
            && WIM_boIsRegistered(WIM__nHilIdDoorWarningVolume))
         {
            WIM_vRelIntEvent(WIM__nHilIdDoorWarningVolume);
         }
         /* release warning 0x20F309 if speed under threshold */
         if (/* speed between threshold 3 and 5 km/h */
            (((WIM__u16GetVelocityDisp() >= 3
                     && WIM__u16GetVelocityDisp() <= 5)
                  /* and old velocity is came from <= 3 */
                  && enLastVelocityValue == WIM_enVelHigh)
               /* or speed under threshold? */
               || WIM__u16GetVelocityDisp() > 5)
            && WIM_boIsRegistered(WIM__nHilIdDoorWarningMute))
         {
            WIM_vRelIntEvent(WIM__nHilIdDoorWarningMute);
         }
         /* activate Warning 0x20F308 */
         if (/* speed between thresholds and come from 5  */
            ((WIM__u16GetVelocityDisp() >= 3
                  && WIM__u16GetVelocityDisp() <= 5)
               && enLastVelocityValue == WIM_enVelHigh)
            /* or speed above threshold? */
            || WIM__u16GetVelocityDisp() > 5)
         {
            if (/* a new door was opened? */
               WIM_boIsRegistered(WIM__nHilIdDoorWarningVolume) == True
               && (~u8OldDoorState & WIM__u8DoorState) != 0)
            {
               if (/* is message ManuQuit */
                  WIM__u8DoorManuQuit == True)
               {
                  /* retrigger warning with sound */
                  WIM_vRetriggerIntEvent(WIM__nHilIdDoorWarningVolume);
                  /* set ManuQuit to False */
                  WIM__u8DoorManuQuit = False;
               }
               else
               {
                  /* retrigger warning only display*/
                  WIM_vRetriggerDisplay(WIM__nHilIdDoorWarningVolume);
               }
            }
            else
            {
               /* activate warning */
               WIM_vSetIntEvent(WIM__nHilIdDoorWarningVolume);
            }
         }
         /* else activate Warning 0x20F309 */
         if (/* speed between threshold 3 and 5 km/h */
         (((WIM__u16GetVelocityDisp() >= 3
                  && WIM__u16GetVelocityDisp() <= 5)
               /* and old velocity is came from <= 3 */
               && enLastVelocityValue == WIM_enVelLow)
            /* or speed under threshold? */
            || WIM__u16GetVelocityDisp() < 3))
         {
            if (/* a new door was opened? */
               WIM_boIsRegistered(WIM__nHilIdDoorWarningMute) == True
               && (~u8OldDoorState & WIM__u8DoorState) != 0)
            {
               WIM_vRetriggerIntEvent(WIM__nHilIdDoorWarningMute);
            }
            else
            {
               /* activate warning */
               WIM_vSetIntEvent(WIM__nHilIdDoorWarningMute);
            }
         }
      }
      /* DoorState changed, update DPOOL data */
      /* Send WIM__u8DoorState */
      if (E_DATA_OK != DPOOL_enSetPoolData(DPOOL_nDataWIM_u8ModelDataDoorState, &WIM__u8DoorDisplayState))
      {
         WIM__vRaiseException(WIM_nErrIcom);
      }
   }
}

/*
*  Check condition if message is ManuQuit 
*  @return  none
*  @param   enEvt event
*  @author  A.Wagner, Schleissheimer GmbH
*/
void WIM_vManuQuitCallback(uint32 u32WarnNumber, WIM_tenDisplayEvent enEvent)
{
   switch (u32WarnNumber)
   {
   case WIM__nHilIdDoorWarningVolume:
      WIM__u8DoorManuQuit = True;      
      break;
   case WIM__nElecStepboardMovedOut:
      WIM__boElStepBoardMovedOut_ManuQuit = True;
      break;
   case WIM__nElecStepboardMovedIn:
      WIM__boElStepBoardMovedIn_ManuQuit = True;
      break;
   /*case WIM__nHilId*/
   default:
      break;
   }
}

/*
*  Set ManuQuit state to false 
*  @return  none
*  @param   enEvt event
*  @author  A.Wagner, Schleissheimer GmbH
*/
void WIM_vReCheckWarnings(void)
{
   WIM__u8DoorManuQuit = False;
   WIM__boElStepBoardMovedIn_ManuQuit = False;
   WIM__boElStepBoardMovedOut_ManuQuit = False;   
   WIM__boIsPrivacyPopupFirstRegistered = False;
}
